import React, { Component } from "react";

export class Task extends Component {
	constructor(props) {
		super(props);
	}
	render() {
		return (
			<tr>
				<td>{this.props.task.name}</td>
				<td>{this.props.task.description}</td>
				<td>{this.props.task.date}</td>
			</tr>
		);
	}
}

export default Task;
